import React from 'react';

import {
    ResponsiveContainer,
    LineChart,
    Line,
    XAxis,
    CartesianGrid,
    Tooltip
} from 'recharts';

import { Container } from './styles';

interface IHistoryBoxProps {
    data: {
        month: string;
        amountEntry: number;
        amountOutput: number;
    }[],
    lineColorAmountEntry: string;
    lineColorAmountOutout: string;
}

const HistoryBox: React.FC<IHistoryBoxProps> = () => (
    <Container>
        <h2>Histórico de Saldo</h2>

        <ResponsiveContainer>
            <LineChart data={[]}>
                <CartesianGrid strokeDasharray="3 3" stroke="#cecece" />
                <XAxis dataKey="month" stroke="#cecece" />
                <Tooltip />
                <Line
                    type="monotone"
                    dataKey="amountEntry"
                    name="Entradas"
                    stroke="#f7931b"
                    strokeWidth={5}
                    dot={{ r: 5}}
                    activeDot={{ r:8}}
                />
                <Line
                    type="monotone"
                    dataKey="amountOutput"
                    name="Saídas"
                    stroke="#e44c4e"
                    strokeWidth={5}
                    dot={{ r: 5}}
                    activeDot={{ r:8}}
                />
            </LineChart>
        </ResponsiveContainer>
        
    </Container>
);


export default HistoryBox;
